#>

# Parameters
$sqlServer   = "$(SQL_SERVER)"
$sqlDatabase = "$(DatabaseName)"

$ErrorActionPreference="Stop"

Import-Module SQLPS -WarningAction SilentlyContinue


# Get ETL type
$settings = Invoke-Sqlcmd -ServerInstance $sqlServer -Database $sqlDatabase -Query "SELECT [Name], [Value] FROM smgt.configuration WHERE configuration_group=''SolutionTemplate'' AND configuration_subgroup=''SalesManagement''"

if ($settings.Count -lt 2)
{
    throw "ERROR: Solution template settings not configured correctly"
}

$etl = ($settings | where {$_.Name -eq "etl"}).Value
$source = ($settings | where {$_.Name -eq "source"}).Value


$pwd_plain   = "put_password here, run, then set this back to empty string"
$pwd_secured = ConvertTo-SecureString $pwd_plain -AsPlainText -Force
$pwd_secured_as_text = $pwd_secured | ConvertFrom-SecureString 


if ($etl -eq "Informatica")
{
    $q = "DELETE FROM smgt.configuration WHERE configuration_group=''informatica'' AND configuration_subgroup=''connection_info'' AND [name]=''password''"
    Invoke-Sqlcmd -ServerInstance $sqlServer -Database $sqlDatabase -Query $q
    $q = "INSERT smgt.configuration(configuration_group, configuration_subgroup, [name], [value]) VALUES(''informatica'', ''connection_info'', ''password'', ''" + $pwd_secured_as_text + "'')"
    Invoke-Sqlcmd -ServerInstance $sqlServer -Database $sqlDatabase -Query $q
}
elseif ($etl -eq "Scribe")
{
    $q = "DELETE FROM smgt.configuration WHERE configuration_group=''scribe'' AND configuration_subgroup=''connection_info'' AND [name]=''password''"
    Invoke-Sqlcmd -ServerInstance $sqlServer -Database $sqlDatabase -Query $q
    $q = "INSERT smgt.configuration(configuration_group, configuration_subgroup, [name], [value]) VALUES(''scribe'', ''connection_info'', ''password'', ''" + $pwd_secured_as_text + "'')"
    Invoke-Sqlcmd -ServerInstance $sqlServer -Database $sqlDatabase -Query $q
}


', 
		@database_name=N'$(DatabaseName)', 
		@flags=0
IF (@@ERROR <> 0 OR @ReturnCode <> 0)
    GOTO QuitWithRollback;
EXEC @ReturnCode = msdb.dbo.sp_update_job @job_id = @jobId, @start_step_id = 1;
IF (@@ERROR <> 0 OR @ReturnCode <> 0)
    GOTO QuitWithRollback;

EXEC @ReturnCode = msdb.dbo.sp_add_jobserver @job_id = @jobId, @server_name = N'(local)';
IF (@@ERROR <> 0 OR @ReturnCode <> 0)
    GOTO QuitWithRollback;

COMMIT TRANSACTION

GOTO EndSave

QuitWithRollback:
    IF (@@TRANCOUNT > 0)
	    ROLLBACK TRANSACTION;
EndSave:


-- CREATE login for SSAS
IF NOT EXISTS (SELECT name FROM master.sys.server_principals WHERE name='NT SERVICE\MSSQLServerOLAPService')
BEGIN
    CREATE LOGIN [NT SERVICE\MSSQLServerOLAPService] FROM WINDOWS WITH DEFAULT_DATABASE=[master], DEFAULT_LANGUAGE=[us_english];
END;
GO

USE [$(DatabaseName)]
GO

IF NOT EXISTS (SELECT * FROM sys.database_principals WHERE name='NT SERVICE\MSSQLServerOLAPService')
BEGIN
    CREATE USER [NT SERVICE\MSSQLServerOLAPService] FOR LOGIN [NT SERVICE\MSSQLServerOLAPService] WITH DEFAULT_SCHEMA=[dbo]
END;
GO

ALTER ROLE [db_datareader] ADD MEMBER [NT SERVICE\MSSQLServerOLAPService]
GO
